import React from "react";
import pdata from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
} from "recharts";
const BarChart = () => {
  return (
    <>
      <ResponsiveContainer width="100%" aspect={2}>
        <LineChart
          data={pdata}
          width={500}
          height={800}
          margin={{ top: 15, right: 8, bottom: 20 }}
        >
          <CartesianGrid strokeDasharray="5 5" />

          <XAxis
            dataKey="name"
            interval={"preserveStartEnd"}
            tickFormatter={(value) => value + ""}
          >
            <Label value="Programming Languages" position="bottom" offset={0} />
          </XAxis>
          <YAxis
            tickCount={9}
            label={{
              value: "student  data",
              angle: -90,
              position: "insideLeft",
            }}
          />
          <Tooltip contentStyle={{ backgroundColor: "yellow" }} />
          <Legend verticalAlign="top" />
          <Line
            type="monotone"
            dataKey="student"
            stroke="red"
            activeDot={{ r: 8 }}
          />
          <Line
            type="monotone"
            dataKey="fees"
            stroke="green"
            activeDot={{ r: 8 }}
          />
        </LineChart>
      </ResponsiveContainer>
    </>
  );
};

export default BarChart;
